function replaceProductNames(productData) {

    var elToReplace = $('.replace-name');

    for(i in productData) {
        var product = productData[i];
        var text = 
			'<div class="tip-block" data-tip="tip_'+i+'">\n' +
            '<a href="'+product.link+'">\n' +
            '<div class="tip-block__image">\n' +
            '<img src="'+product.image+'" alt="">\n' +
            '</div>\n' +
            '<div class="tip-block__link">\n' +
            '<span class="tip-block__linktext"></span>\n' +
            '</div></a>\n' +
            '</div>\n' +
			'<span class="text-tip" data-tip="tip_'+i+'">\n' +
            '<a href="'+product.link+'" class="tip-title"></a>\n' +
            '</span>';
			
		var text2 = 
			'<div class="tip-block" data-tip="tip_'+i+'">\n' +
            '<a href="'+product.link+'">\n' +
            '<div class="tip-block__image">\n' +
            '<img src="'+product.image+'" alt="">\n' +
            '</div>\n' +
            '<div class="tip-block__link">\n' +
            '<span class="tip-block__linktext"></span>\n' +
            '</div></a>\n' +
            '</div>\n' +
			'<span class="text-tip text-tip_dot" data-tip="tip_'+i+'">\n' +
            '<a href="'+product.link+'" class="tip-title"></a>\n' +
            '</span>';	

        elToReplace.each(function(){
            $(this).find('a[href="'+product.link+'"]').each(function(){
				
				if( $(this).attr('data-dot') == '1' ){
					$(text2).insertAfter($(this)).find('.tip-title').html($(this).html());
				} else {
					$(text).insertAfter($(this)).find('.tip-title').html($(this).html());
				}

                
                $(this).remove();
            });
        });
    }
}

Share = {
    /**
     *        
     *     inline-js  
     *             
     *
     * @example <a href="" onclick="return share.go(this)">like+</a>
     *
     * @param Object _element -  DOM,  
     * @param Object _options - ,  
     */
    go: function(_element, _options) {
        var
            self = Share,
            options = $.extend(
                {
                    type:       'vk',    //  
                    url:        location.href,  //   
                    count_url:  location.href,  //     
                    title:      document.title, //  
                    image:        '',             //  
                    text:       '',             //  
                },
                $(_element).data(), //     data,   
                _options            //       
            );

        if (self.popup(link = self[options.type](options)) === null) {
            //     
            if ( $(_element).is('a') ) {
                //   <a>,          
                $(_element).prop('href', link);
                return true;
            }
            else {
                //    <a>,     
                location.href = link;
                return false;
            }
        }
        else {
            //   ,     
            return false;
        }
    },

    // 
    vk: function(_options) {
        var options = $.extend({
            url:    location.href,
            title:  document.title,
            image:  '',
            text:   '',
        }, _options);

        return 'http://vkontakte.ru/share.php?'
            + 'url='          + encodeURIComponent(options.url)
            + '&title='       + encodeURIComponent(options.title)
            + '&description=' + encodeURIComponent(options.text)
            + '&image='       + encodeURIComponent(options.image)
            + '&noparse=true';
    },

    // 
    ok: function(_options) {
        var options = $.extend({
            url:    location.href,
            text:   '',
        }, _options);

        return 'https://connect.ok.ru/offer?'
            + '&title=' + encodeURIComponent(options.text)
            + '&url='    + encodeURIComponent(options.url);
    },

    // Facebook
    fb: function(_options) {
        var options = $.extend({
            url:    location.href,
            title:  document.title,
            image:  '',
            text:   '',
        }, _options);

        return 'http://www.facebook.com/sharer.php?s=100'
            + '&p[title]='     + encodeURIComponent(options.title)
            + '&p[summary]='   + encodeURIComponent(options.text)
            + '&p[url]='       + encodeURIComponent(options.url)
            + '&p[images][0]=' + encodeURIComponent(options.image);
    },

    //  
    lj: function(_options) {
        var options = $.extend({
            url:    location.href,
            title:  document.title,
            text:   '',
        }, _options);

        return 'http://livejournal.com/update.bml?'
            + 'subject='        + encodeURIComponent(options.title)
            + '&event='         + encodeURIComponent(options.text + '<br/><a href="' + options.url + '">' + options.title + '</a>')
            + '&transform=1';
    },

    // 
    tw: function(_options) {
        var options = $.extend({
            url:        location.href,
            count_url:  location.href,
            title:      document.title,
        }, _options);

        return 'http://twitter.com/share?'
            + 'text='      + encodeURIComponent(options.title)
            + '&url='      + encodeURIComponent(options.url)
            + '&counturl=' + encodeURIComponent(options.count_url);
    },

    // Mail.Ru
    mr: function(_options) {
        var options = $.extend({
            url:    location.href,
            title:  document.title,
            image:  '',
            text:   '',
        }, _options);

        return 'http://connect.mail.ru/share?'
            + 'url='          + encodeURIComponent(options.url)
            + '&title='       + encodeURIComponent(options.title)
            + '&description=' + encodeURIComponent(options.text)
            + '&imageurl='    + encodeURIComponent(options.image);
    },

    //LinkedIn
    li: function(_options) {
        var options = $.extend({
            url:    location.href,
            title:  document.title,
            text:   ''
        }, _options);

        return 'http://www.linkedin.com/shareArticle?mini=true'
            + '&url='       + encodeURIComponent(options.url)
            + '&title='     + encodeURIComponent(options.title)
            + '&summary='   + encodeURIComponent(options.text);
    },

    //   
    popup: function(url) {
        return window.open(url,'','toolbar=0,status=0,scrollbars=1,width=626,height=436');
    }
}
